import React, {useState} from 'react';


interface todos {
    key:number;
    todo:object;
    index:any

}

const todo: React.FC = ({todo, index}:todos)=>{
    return true


}

export const Todo: React.FC =()=>{
const [todos, setTodos] = useState<[{text:string;isCompleted:boolean}]>([
    {
    text:'sal',
    isCompleted:false 
    },


])
return(
    <div className='todo-list'>
        {todos.map((todo,idx)=>(
            <todo key={index} index={idx} todo={todo} />
        ))}
    </div>
        


)

}
